svg.script:
function onloadSVG(event) {
	var pathElements = event.target.getElementsByTagName('path');
	for (var i = 0; i < 2; i++) { //magic number 2: the first and second elements should respond to events
		pathElements.item(i).addEventListener("mouseover", onmouseoverArea, false);
		pathElements.item(i).addEventListener("mouseout",  onmouseoutArea,  false);
	}

	for (var i = 19; i < pathElements.length; i++) { //magic number 19: from the 20th. element the paths represent westeros areas
		pathElements.item(i).addEventListener("mouseover", onmouseoverArea, false);
		pathElements.item(i).addEventListener("mouseout",  onmouseoutArea,  false);
	}

}

function onmouseoverArea(event) {
	event.target.setAttribute('fill', '#eee');
}

function onmouseoutArea(event) {
	event.target.setAttribute('fill', '#fff');
}
